Parameter.Abstract:
array containing dictionaries of floor info. Example for one floor:
{
     "id" : @"BEACONPOINTFLOOR_NAME",
     "maasId" : 195842,

     "upperLeft" : {
         "longitude" : -97.742525,
         "latitude" : 30.360108
     },
     "lowerRight" : {
         "longitude" : -97.741753,
         "latitude" : 30.359737
     }
}
